INSERT INTO `products` (`id`, `name`, `price`, `brandname`, `image`, `description`, `featured`) VALUES
(1, 'NIKON Z5 Mirrorless Camera', 14499, 'NIKON', , 'NIKON Z5 Mirrorless Camera 24-200 mm  (Black). Your full-frame mirrorless journey starts here. Push the limits of your creativity with Z 5, an innovative full frame mirrorless camera built around Nikon\'s revolutionary Z mount. Compact yet powerful, simple yet sophisticated, it\'s ready to grow with you. Whatever your skill level, the Z 5 delivers detailed imagery, precision autofocus and the tools you need to be as creative as possible. Harness the entire view of expansive full frame lenses, and capture over 50% more image area than crop-sensor cameras. Z 5\'s 24.3', 1),
(2, 'APPLE iPhone 14', 71999, 'APPLE', , 'APPLE iPhone 14 (Blue, 128 GB)', 1),
(3, 'SAMSUNG HD LED Smart Tizen TV', 11999, 'SAMSUNG', , 'SAMSUNG 80 cm (32 Inch) HD Ready LED Smart Tizen TV with Bezel-free Design  (UA32T4380AKXXL). With this Samsung TV, every image on the screen comes to life, giving you a home theatre experience. With the HD visual quality of this TV, you can enjoy vibrant movie scenes. Additionally, HDR increases the screen\'s brightness and brings out the subtleties of the material. Moreover, the Contrast Enhancer on this TV improves contrast and offers superb image quality with increased depth.', 1),
(4, 'APPLE 2020 Macbook Air', 82900, 'APPLE', , 'APPLE 2020 Macbook Air M1 - (8 GB/256 GB SSD/Mac OS Big Sur) MGN63HN/A  (13.3 inch, Space Grey, 1.29 kg)', 1);
INSERT INTO `products` (`id`, `name`, `price`, `brandname`, `image`, `description`, `featured`) VALUES
(5, 'boAt Bluetooth Speaker', 4999, 'BOAT', , 'boAt Partypal 53 Portable Speaker with RGB LEDs and Mic for Calls 30 W Bluetooth Speaker  (Midnight Black, Stereo Channel). Wherever the party is tonight, make sure you carry the powerful 30W R.M.S Sound of the PartyPal 53 along. It\'s time to create memories with Bluetooth v5.1 powered wireless speakers guiding you to the shores of audio bliss. So, get loud and vibing with the integral party inspired design of the boAt PartyPal 53 that come with RGB LEDs. Tune into any mode you want with FM Radio, USB or AUX modes apart from the wireless connectivity. The speaker offers resistance against splashes with an IPX5 marked water resistance. It offers a total playback time of up to 4.5 hours with the support of Type C charging interface. You can control the playback, activate default smart voice assistant and attend calls via the easy to access controls.', 1),
(6, 'ASUS TUF Gaming Laptop', 54990, 'ASUS', , 'ASUS TUF Gaming A15 Ryzen 5 Hexa Core AMD R5-4600H - (8 GB/1 TB SSD/Windows 11 Home/4 GB Graphics/NVIDIA GeForce GTX 1650/144 Hz) FA506IHRZ-HN112W Gaming Laptop  (15.6 inch, Graphite Black, 2.30 Kg). The excellent TUF Gaming A15 laptop, which is packed with cutting-edge technologies, provides fantastic gaming performance and a wonderful user interface. The GeForce RTX GPU and AMD Ryzen CPU on this laptop provide seamless gaming and faultless multitasking. Additionally, a honeycomb-patterned material on the base increases grip and mimics the hexagonal chassis reinforcements, adding a soft texture that appears clean and polished. Enhanced aural immersion is made possible by the loud and potent two speakers that have four cutouts. High-fidelity audio is delivered by DTS:X Ultra for crisp, clear sound. Moreover, this laptop is ideal for action-packed gaming because it has a quick 144 Hz IPS-level panel. Adaptive-Sync synchronises the GPU\'s frame rate with the display\'s refresh rate to lessen lag, cut down on stuttering, and eliminates visual tearing for incredibly smooth and engrossing gameplay.', 1);
INSERT INTO `products` (`id`, `name`, `price`, `brandname`, `image`, `description`, `featured`) VALUES
(7, 'BOAT Storm call Smartwatch', 1799, 'BOAT', , 'BOAT Storm call 1.69 inch HD display with bluetooth calling and 550 nits brightness Smartwatch  (Black Strap, Free Size). The BOAT Storm Call is the perfect companion for your fitness transformation. Your Watch Storm Call is here to remove all obstructions that may come on your goal achieving path. The watch comes with Bluetooth calling and a Dialpad that saves up to 10 contacts, for you to stay connected 24x7. With its daily activity tracker and multiple sports modes, it will now be fun to track your journey towards health. Stay alert at all times with smart notifications from your phone with vibration alerts for calls, texts, sedentary reminders, alarms, & more! The wellness mode of the smartwatch monitors your heart rate, blood oxygen levels. And when you want to disconnect with the outside world, there\'s the DND feature on the watch to disable all notifications. Its find my phone feature will call your phone to easily locate your phone when you don\'t remember where you kept it. The IP68 dust, sweat and splash resistance will keep the watch safe in all circumstances! Moreover, you can customize your watch face with cloud based watch faces on Storm Call to flaunt your fitness wherever you go!', 1),
(8, 'BOAT Airdopes Charge Bluetooth Headset', 1299, 'BOAT', , 'BOAT Airdopes 131 with upto 60 Hours and ASAP Charge Bluetooth Headset  (Cherry Blossom, True Wireless). Are you looking for a wireless earbud-type headset that delivers an impressive playback time? If your answer is yes, bring home the boAt Airdopes 131 that comes with a carrying case. This carrying case also acts as a 650 mAh portable charger that extends the playback time of these earbuds by up to 15 hours, i.e. 4 times its normal charging capacity. The normal battery capacity of each of these earbuds is 40 mAh and this delivers up to 3 hours of playback time. These earbuds feature Bluetooth v5.0 technology that delivers a stable connection that lets your rock on without connectivity issues. The stereo calling feature of these earbuds allows you to enjoy calls via its built-in microphone and 13-mm drivers. These earbuds are powered up by the IWP Technology featured in them the moment you open the case. The presence of a Type-C charging port ensures you can easily charge it with any charger that has a compatible cable.', 1),
(19, 'SWAPITECH RGB Gaming Mouse', 699, 'SWAPITECH', , 'SWAPITECH RGB Gaming Mouse ST-MWG-01 Adj DPI Upto 6400, 7 Programmable Buttons Wired Optical Gaming Mouse  (USB 2.0, Black). Swapitech RGB Gaming Mouse is a Full Sized Ergonomic Gaming Mouse that fits perfectly in most hands, and delivers a precise and satisfying Gaming Experience. Ambidextrous comfortable design which is affordable in price but uncompromising in functionality and performance. 7 Programmable buttons lets you easily adapt to your environment and helps you to Customize 4 profiles, 4 Breathing Light Effects ensures a cool look. The Software is available (on brand website) and can Customize All 7 Buttons, adjust the DPI Levels, and the LED lighting schemes. Adjust your tools to suit your style and comfort. Cycle through up to 4 DPI settings (2400/3200/4800/6400) upto a maximum of 6400 DPI which gives gamers pinpoint accuracy and superior efficiency. Excellent movement speed and precise mouse control and best response time for better gaming experience. It comes with a gaming grade sensor for quick movements and reflexes. It also has extra durable switches and enhanced build quality to increase the durability of the mouse. It is optimized for precise targeting, perfect speed and acceleration which gives consistent accuracy and movement speed for powerful game play. Its powered by standard USB Cable, PLUG & PLAY Support, No Driver Needed. It comes with a 1.8 meter braided cable and magnetic ring for extra durability and better Data Transmission. This multi-functional Mouse is fully compatible with Windows 7 / 8 / 10 / 11, MAC and Linux. This mouse works on almost any surface with astounding accuracy that provides comfort for long hours. Designed for comfortable use over extended periods of time, the Swapitech RGB Optical Wired Mouse is your desktop partner.', 1),
(21, 'DELL Gaming Laptop', 334990, 'Dell', , 'DELL Alienware Core i9 12th Gen - (32 GB/1 TB HDD/1 TB SSD/Windows 11 Home/8 GB Graphics/NVIDIA GeForce RTX 3070 Ti/165 Hz) Alienware x17 R2 Gaming Laptop  (17.3 Inch, Lunar Light, 2.96 Kg, With MS Office)', 1);
